1: t79   → {NT76}  
2: t44   → {NT7}  
3: t58   → {NT46}  
4: t9    → {NT41, NT73, NT34}  
5: t9    → {NT41, NT73, NT34}  
6: t18   → {NT6}

Length‑2 spans give  
(1–2) {NT70} because NT70→NT76 NT7  
(4–5) {NT23} because NT23→NT73 NT41  

Length‑3 spans give  
(1–3) {NT13} because NT13→NT70 NT46  
(4–6) {NT69} because NT69→NT23 NT6

Finally, the full span (1–6) yields S because S→NT13 NT69.  Hence the grammar does generate the string.

